import React from "react";
import styled from "styled-components";

const Wrapper = styled.div``;

const MainText = styled.h1`
	font-size: 50px;
`;

const Message = styled.h3`
	font-size: 20px;
`;

const WrapperSearch = styled.div`
	width: 289px;
	border: 1px solid red;
	padding: 5px;
`;

const Input = styled.input`
	border: none;
	width: 200px;
`;

const InputClick = styled.input`
	background-color: blue;
	color: white;
	padding: 5px 10px;
	border: none;
	border-radius: 5px;
`;

const WrapperChecks = styled.div`
	display: flex;
`;

const WrapperCheck = styled.div`
	display: flex;
	margin: 10px;
`;

const checkImg = "../images/check.png";
const CheckImg = styled.img`
	width: 20px;
	height: 20px;
	margin-top: 10px;
	margin-right: 10px;
`;

const CheckText = styled.p`
	font-size: 12px;
`;

class Develop extends React.Component {
	render() {
		return (
			<Wrapper>
				<MainText>
					Your Strategy is only as good <br /> as your ability to execute it.
				</MainText>
				<Message>
					Perdoo is a simple but powerful toolkit for turning great
					<br />
					strategies into amaizing results. And it is free.
				</Message>
				<WrapperSearch>
					<Input type="text" />
					<InputClick type="submit" value="Get started" />
				</WrapperSearch>

				<WrapperChecks>
					<WrapperCheck>
						<CheckImg src={checkImg} alt="imagen del check" />
						<CheckText>Free forever</CheckText>
					</WrapperCheck>
					<WrapperCheck>
						<CheckImg src={checkImg} alt="imagen del check" />
						<CheckText>Unlimited goals</CheckText>
					</WrapperCheck>
					<WrapperCheck>
						<CheckImg src={checkImg} alt="imagen del check" />
						<CheckText>Unlimited Users</CheckText>
					</WrapperCheck>
				</WrapperChecks>
			</Wrapper>
		);
	}
}

export default Develop;
